--  DDL for View VW_CREDITOPERIODO
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "SAPREGSF1"."VW_CREDITOPERIODO" ("PERACT", "PERANT", "NCONSUMO", "MES", "ANIO", "MESANT", "ANIOANT", "NCODIGO_CONCESIONARIO", "NCODIGO", "SESTADO") AS 
  SELECT SAPR_CONSUMOSALDO.MES || '-' || SAPR_CONSUMOSALDO.ANIO
               PERACT,
           SAPR_CONSUMOSALDO.MESANT || '-' || SAPR_CONSUMOSALDO.ANIOANT
               PERANT,
           SAPR_CONSUMOSALDO.NCONSUMO,
           SAPR_CONSUMOSALDO.MES,
           SAPR_CONSUMOSALDO.ANIO,
           SAPR_CONSUMOSALDO.MESANT,
           SAPR_CONSUMOSALDO.ANIOANT,
           SAPR_CONSUMOSALDO.NCODIGO_CONCESIONARIO,
           SAPR_CONSUMOSALDO.NCODIGO,
           SAPR_CONSUMOSALDO.SESTADO
      FROM SAPR_CONSUMOSALDO;
--------------------------------------------------------
--  DDL for View VW_CREDITOS
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "SAPREGSF1"."VW_CREDITOS" ("NCODIGO", "ANIO", "MES", "NCONSUMO", "SESTADO", "MESANT", "ANIOANT", "MODS", "NCODIGO_CONCESIONARIO", "FECHACREDITO", "FECHADJAPLICACREDITO", "ORDEN") AS 
  SELECT X.NCODIGO, 
                        X.ANIO,
                        X.MES,
                        X.NCONSUMO,
                        X.SESTADO,
                        X.MESANT,
                        X.ANIOANT,
                        X.MODS,
                        X.NCODIGO_CONCESIONARIO,
                        X.FECHACREDITO,
                        X.FECHADJAPLICACREDITO,
                        X.ORDEN
FROM 
(
    Select D.NCODIGO, 
           D.ANIO,
           D.MES,
           D.NCONSUMO,
           D.SESTADO,
           D.MESANT,
           D.ANIOANT,
          (CASE WHEN D.NCODIGO_APORTE=-1 THEN 'MANUAL' ELSE 'POR DEFECTO' END) MODS,
           D.NCODIGO_CONCESIONARIO,
          (
            SELECT TO_CHAR((MAX(S.DFECHAREG_PAGO)),'DD/MM/YYYY') 
            FROM SAPR_PAGOSINAPORTE S WHERE S.MES=D.MESANT AND S.ANIO=D.ANIOANT AND S.NCODINST=D.NCODIGO_CONCESIONARIO 
            AND S.SESTADOSA<>'0' and s.NCODIGOCP='1'
          ) FECHACREDITO,
          (
            SELECT TO_CHAR(A.DFECHAREGISTRO,'DD/MM/YYYY') FROM SAPR_APORTE A WHERE A.NCODIGO_APORTE=D.NCODIGO_APORTE 
          ) FECHADJAPLICACREDITO,
          '1' ORDEN
    From  SAPR_CONSUMOSALDO D
    
    UNION ALL
    
    SELECT  -1,
            '',
            '',
            V.MONTO,
            '99',
            V.SMES_PERIODO,
            V.SANIO_PERIODO ,
            (CASE WHEN V.NCODIGO_APORTE=-1 THEN 'MANUAL' ELSE 'POR DEFECTO' END) MODS,
            CONCESIONARIO,
            (
            SELECT TO_CHAR((MAX(S.DFECHAREG_PAGO)),'DD/MM/YYYY') 
            FROM SAPR_PAGOSINAPORTE S WHERE S.MES=V.SMES_PERIODO AND S.ANIO=V.SANIO_PERIODO AND S.NCODINST=V.CONCESIONARIO 
            AND S.SESTADOSA<>'0' and s.NCODIGOCP='1'
          ) FECHACREDITO,
            '',
            '0' ORDEN
    FROM VW_CREDSINASIGNAR V
    ) X;
--------------------------------------------------------
--  DDL for View VW_CREDSINASIGNAR
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "SAPREGSF1"."VW_CREDSINASIGNAR" ("SANIO_PERIODO", "SMES_PERIODO", "MONTO", "NCODIGO_APORTE", "CONCESIONARIO") AS 
  SELECT x.SANIO_PERIODO,X.SMES_PERIODO,X.monto,X.ncodigo_aporte,X.CONCESIONARIO
 FROM(SELECT A.SANIO_PERIODO,
            A.SMES_PERIODO,
            ( (A.SALDO)+PK_SAPR_SALDOS.PRC_SUMAREXCESOPAGOYDJ(a.ncodigo_aporte,a.ndeuda) ) *-1 monto,
            a.ncodigo_aporte,
            A.CONCESIONARIO
      FROM VW_DJCRED A
      WHERE 
             (a.SMES_PERIODO,a.SANIO_PERIODO,a.CONCESIONARIO ) not in 
           (select S.MESANT,S.ANIOANT,S.NCODIGO_CONCESIONARIO 
                    from
                    SAPR_CONSUMOSALDO S
                              WHERE
                               (S.NCODIGO_APORTE IN (-1,/*modo manual */ 
                                                    A.NCODIGO_APORTE) /* DJ */
                              AND S.SESTADO   IN ('1','2'))                             
                              AND S.NCODIGO_CONCESIONARIO=A.CONCESIONARIO)
           AND A.SESTADO NOT IN ('I','E')
           
  ) x
  where (x.monto*-1)>0
  order by x.SANIO_PERIODO DESC,x.SMES_PERIODO DESC;
--------------------------------------------------------
--  DDL for View VW_DECLARACIONES_ACT
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "SAPREGSF1"."VW_DECLARACIONES_ACT" ("SANIO_PERIODO", "SMES_PERIODO", "NAPORTE_MONTO", "NINTERESGEN_MONTO", "NCREDITO_MONTO", "NPAGO_MONTO", "SALDO", "NPAGO_INTERES", "NCODIGO_APORTE", "CONCESIONARIO", "NMONTOPAGAR", "NCODIGO_PERIODO", "NCODIGO_TIPODECLARACION", "NCODIGO_TIPOPRESENTACION", "SESTADO", "NDEUDA") AS 
  SELECT P.SANIO_PERIODO,
             P.SMES_PERIODO,
             a.NAPORTE_MONTO,
             a.NINTERESGEN_MONTO,
             a.NCREDITO_MONTO,
             a.NPAGO_MONTO,
             a.NSALDOPERIDO    SALDO,
             a.NPAGO_INTERES,
             a.ncodigo_aporte,
             P.NCODIGO_CONSECION CONCESIONARIO,
             A.NMONTOPAGAR,
             A.NCODIGO_PERIODO,
             A.NCODIGO_TIPODECLARACION,
             A.NCODIGO_TIPOPRESENTACION,
             A.SESTADO,
             A.NDEUDA
        FROM SAPR_APORTE A
             INNER JOIN SAPR_PERIODO P ON A.NCODIGO_PERIODO = P.NCODIGO_PERIODO
       WHERE     A.NORDEN =
                 (SELECT MAX (B.NORDEN)
                    FROM SAPR_APORTE B
                   WHERE     B.NCODIGO_PERIODO = A.NCODIGO_PERIODO
                         AND B.SESTADO = 'P')
             AND A.SESTADO = 'P'
    ORDER BY P.SANIO_PERIODO DESC, P.SMES_PERIODO DESC;
