  CREATE OR REPLACE FORCE EDITIONABLE VIEW "SAPREGSF1"."VW_DJCRED" ("SANIO_PERIODO", "SMES_PERIODO", "NAPORTE_MONTO", "NINTERESGEN_MONTO", "NCREDITO_MONTO", "NPAGO_MONTO", "SALDO", "NPAGO_INTERES", "NCODIGO_APORTE", "CONCESIONARIO", "NMONTOPAGAR", "NCODIGO_PERIODO", "NCODIGO_TIPODECLARACION", "NCODIGO_TIPOPRESENTACION", "SESTADO", "NDEUDA", "DFECHAREGISTRO", "DFECHAMODIFICA", "NORDEN", "NSALDOPERIDO", "NTOTALINGRESO", "DFECVENCIMDJ", "DFECVENCIMPG", "ESTREGVDJ") AS 
  SELECT P.SANIO_PERIODO,
P.SMES_PERIODO,
A.NAPORTE_MONTO,
A.NINTERESGEN_MONTO,
A.NCREDITO_MONTO,
A.NPAGO_MONTO,
A.NSALDOPERIDO SALDO,
A.NPAGO_INTERES,
A.NCODIGO_APORTE,
P.NCODIGO_CONSECION CONCESIONARIO,
A.NMONTOPAGAR,
A.NCODIGO_PERIODO,
A.NCODIGO_TIPODECLARACION,
A.NCODIGO_TIPOPRESENTACION,
A.SESTADO,A.NDEUDA,
A.DFECHAREGISTRO,
A.DFECHAMODIFICA,
A.NORDEN,
A.NSALDOPERIDO,
A.NTOTALINGRESO,
A.DFECVENCIMDJ,
A.DFECVENCIMPG,
CASE WHEN A.DFECVENCIMDJ-A.DFECHAREGISTRO>=0 THEN 'DP' ELSE 'FP' END ESTREGVDJ
FROM SAPR_APORTE A
INNER JOIN SAPR_PERIODO P 
ON A.NCODIGO_PERIODO=P.NCODIGO_PERIODO 
WHERE A.NORDEN=(SELECT MAX(B.NORDEN) 
                FROM SAPR_APORTE B 
                WHERE B.NCODIGO_PERIODO=A.NCODIGO_PERIODO              
               )      
ORDER BY P.SANIO_PERIODO DESC,P.SMES_PERIODO DESC;
