  CREATE OR REPLACE FORCE EDITIONABLE VIEW "SAPREGSF1"."VW_DJSALDOS" ("NCODIGO_APORTE", "SALDO", "NDEUDA", "SANIO_PERIODO", "SMES_PERIODO", "CONCESIONARIO", "SESTADO", "DFECVENCIMPG") AS 
  SELECT Q.ncodigo_aporte,Q.NSALDOPERIDO SALDO,Q.ndeuda,P.SANIO_PERIODO,P.SMES_PERIODO,P.NCODIGO_CONSECION CONCESIONARIO,Q.SESTADO,Q.DFECVENCIMPG
            FROM SAPR_APORTE Q
