  CREATE OR REPLACE FORCE EDITIONABLE VIEW "SAPREGSF1"."VW_GETAPORTESBYPERIODOADMIN" ("NCODIGO_APORTE", "NCODIGO_PERIODO", "NCODIGO_TIPODECLARACION", "NCODIGO_TIPOPRESENTACION", "NAPORTE_MONTO", "NPAGO_MONTO", "NCREDITO_MONTO", "NINTERESGEN_MONTO", "SESTADO", "DFECHAREGISTRO", "NORDEN", "NSALDOPERIDO", "NTOTALINGRESO", "NMONTOPAGAR", "SNOMBRE_TIPODECLARACION", "NDEUDA", "NPAGO_INTERES", "DFECVENCIMDJ") AS 
  SELECT A.NCODIGO_APORTE           AS NCODIGO_APORTE,
       A.NCODIGO_PERIODO          AS NCODIGO_PERIODO,
       A.NCODIGO_TIPODECLARACION  AS NCODIGO_TIPODECLARACION,
       A.NCODIGO_TIPOPRESENTACION AS NCODIGO_TIPOPRESENTACION,
       A.NAPORTE_MONTO            AS NAPORTE_MONTO,
       A.NPAGO_MONTO              AS NPAGO_MONTO,
       A.NCREDITO_MONTO           AS NCREDITO_MONTO,
       A.NINTERESGEN_MONTO        AS NINTERESGEN_MONTO,
       A.SESTADO                  AS SESTADO,
       (CASE
           WHEN A.DFECHAREGISTRO IS NULL THEN ' '
           ELSE TO_CHAR (A.DFECHAREGISTRO, 'DD/MM/YYYY')
        END)
          AS DFECHAREGISTRO,
       A.NORDEN                   AS NORDEN,
       A.NSALDOPERIDO             AS NSALDOPERIDO,
       A.NTOTALINGRESO            AS NTOTALINGRESO,
       A.NMONTOPAGAR              AS NMONTOPAGAR,
       TD.SNOMBRE_TIPODECLARACION AS SNOMBRE_TIPODECLARACION,
       A.NDEUDA                   AS NDEUDA,
       NPAGO_INTERES              AS NPAGO_INTERES,
       (CASE
           WHEN A.DFECVENCIMDJ IS NULL THEN ' '
           ELSE TO_CHAR (A.DFECVENCIMDJ, 'DD/MM/YYYY')
        END)
          DFECVENCIMDJ
  FROM SAPR_APORTE A
       INNER JOIN SAPR_TIPODECLARACION TD
          ON A.NCODIGO_TIPODECLARACION = TD.NCODIGO_TIPODECLARACION;
