  CREATE OR REPLACE FORCE EDITIONABLE VIEW "SAPREGSF1"."VW_MENU" ("ORDMENU", "NCODSUBMENU", "NOMMENU", "URLMENU", "NCODPERFIL") AS 
  SELECT SM.NORDEN      ORDMENU,
             SM.NCODSUBMENU,
             TSB.SDESCRIPCION NOMMENU,
             P.SPAGINA      URLMENU,
             SM.NCODPERFIL
        FROM SAPR_SUBMENU SM
             INNER JOIN SAPR_TITULO_SUBMENU TSB
                 ON TSB.NCODTITULOSBM = SM.NCODTITULOSBM
             LEFT JOIN SAPR_PAGINA P ON P.NCODPAGINA = SM.NCODPAGINA
       WHERE SM.SESTADO = '1' AND TSB.SESTADO = '1'
    ORDER BY SM.NORDEN;
