  CREATE OR REPLACE FORCE EDITIONABLE VIEW "SAPREGSF1"."VW_REPORTEMULTA" ("M1", "M2", "M3", "M4", "M5", "M6", "M7", "M8", "M9", "M10", "M11", "M12", "M13", "M14", "M15", "M16", "M17", "M18", "M19", "M20", "M21") AS 
