                      A.NCODIGO_PSAD M1,
                      A.MES M2,
                      A.ANIO M3,
                      (Select SNOMBRE_BANCO From Sapr_Banco where NCODIGO_BANCO= A.Ncodigo_Banco) M4,                           
                      to_char(A.Dfechareg_Pago,'dd/MM/yyyy')M5,                           
                      A.Snoperacion_Pago M6,                           
                      A.NIMPORTE M7,                                                     
                      (SELECT C.SDESCRIPCION FROM SAPR_CONCEPTOPAGO C WHERE C.NCODIGOCP=A.NCODIGOCP) M8,                                                 
                      A.SestadoMU M9,                           
                      A.SNOTAMU M10,
                      A.SRUTA M11,
                      to_char(A.DFECHAREG,'dd/MM/yyyy') M12,
                      --'' ,
                      --'' ,
                      (SELECT CNC_NOMBRE FROM SCINVGSF.T_CONCESIONARIO WHERE CNC_ID=A.NCODINST) M13,
                      A.Snota M14,
                      --'',
                      --'',
                      to_char(A.DFECHAOSIMU,'dd/MM/yyyy') M15,
                      '' M16,--PK_SAPR_APORTE.FUN_GETFECHAVENCIMIENTOPAGO(A.ANIO,A.MES,A.NCODINST) M16,
                      '' M17,--TO_CHAR(PK_UTIL_DATE.FN_SUMARDIAS_HAB(TO_DATE(PK_SAPR_APORTE.FUN_GETFECHAVENCIMIENTOPAGO(A.ANIO,A.MES,A.NCODINST),'dd/MM/yyyy'),2),'dd/MM/yyyy') M17,
                      '' M18,--CASE WHEN A.DFECHAOSIMU IS NULL THEN '' WHEN TO_DATE(PK_SAPR_APORTE.FUN_GETFECHAVENCIMIENTOPAGO(A.ANIO,A.MES,A.NCODINST),'dd/MM/yyyy')>=PK_UTIL_DATE.FN_FORMATEAR(A.DFECHAOSIMU,'dd/MM/yyyy') THEN 'DENTRO DEL PLAZO' ELSE 'FUERA DEL PLAZO' END M18,
                      '' M19,--CASE WHEN PK_UTIL_DATE.FN_SUMARDIAS_HAB(TO_DATE(PK_SAPR_APORTE.FUN_GETFECHAVENCIMIENTOPAGO(A.ANIO,A.MES,A.NCODINST),'dd/MM/yyyy'),2)>=PK_UTIL_DATE.FN_FORMATEAR(A.DFECHAREG,'dd/MM/yyyy') THEN 'DENTRO DEL PLAZO' ELSE 'FUERA DEL PLAZO' END M19,
                      A.NCODIGOCP M20,
                      A.NCODINST M21
                      FROM SAPR_PAGOSINAPORTE A 
                      INNER JOIN SCINVGSF.T_CONCESIONARIO C ON C.CNC_ID=A.NCODINST 
                      LEFT JOIN SAPR_BANCO B ON B.NCODIGO_BANCO = A.NCODIGO_BANCO;
