  CREATE OR REPLACE FORCE EDITIONABLE VIEW "SAPREGSF1"."VW_REPORTEPAGO" ("X1", "X2", "X3", "X4", "X5", "X6", "X7", "X8", "X9", "X10", "X11", "X12", "X13", "X14", "X15", "X16", "X17", "X18", "X19", "X20", "X21", "X22", "X23", "X24", "X25", "X26", "X27", "X28", "X29", "X30") AS 
  Select 
            D.NCODIGO_PAGO X1,                           
            A.MES X2,
            A.ANIO X3,
            (Select SNOMBRE_BANCO From Sapr_Banco where NCODIGO_BANCO= A.Ncodigo_Banco) AS X4,                           
            to_char(A.Dfechareg_Pago,'dd/MM/yyyy') X5,                           
            A.Snoperacion_Pago X6,                           
            A.NIMPORTE  X7,                                                     
            (SELECT C.SDESCRIPCION FROM SAPR_CONCEPTOPAGO C WHERE C.NCODIGOCP=A.NCODIGOCP) X8,                                                 
            D.Sestado  X9,                           
            D.Snota  X10,
            A.SRUTA  X11,
            to_char(A.DFECHAREG,'dd/MM/yyyy') X12,
            '' X13,
            CASE WHEN PK_UTIL_DATE.FN_DIFERECIA(A.DFECHAREG,(PK_UTIL_DATE.FN_SUMARDIAS_HAB(A.DFECHAREG_PAGO,2)),'DD/MM/YYYY')>0 THEN 'FUERA DEL PLAZO' ELSE 'DENTRO DEL PLAZO' END X14,
            (SELECT CNC_NOMBRE FROM SCINVGSF.T_CONCESIONARIO WHERE CNC_ID=A.NCODINST) X15,
            A.Snota X16,
            t.SNOMBRE_TIPODECLARACION X17,
            '' X18,
            to_char(D.DFECHAOSI,'dd/MM/yyyy')X19,
            PK_SAPR_APORTE.FUN_GETFECHAVENCIMIENTOPAGO(A.ANIO,A.MES,A.NCODINST) X20,
            TO_CHAR(PK_UTIL_DATE.FN_SUMARDIAS_HAB(TO_DATE(PK_SAPR_APORTE.FUN_GETFECHAVENCIMIENTOPAGO(A.ANIO,A.MES,A.NCODINST),'dd/MM/yyyy'),2),'dd/MM/yyyy')X21,
            CASE WHEN D.DFECHAOSI IS NULL THEN '' WHEN TO_DATE(PK_SAPR_APORTE.FUN_GETFECHAVENCIMIENTOPAGO(A.ANIO,A.MES,A.NCODINST),'dd/MM/yyyy')>=PK_UTIL_DATE.FN_FORMATEAR(D.DFECHAOSI,'dd/MM/yyyy') THEN 'DENTRO DEL PLAZO' ELSE 'FUERA DEL PLAZO' END X22,
            CASE WHEN PK_UTIL_DATE.FN_SUMARDIAS_HAB(TO_DATE(PK_SAPR_APORTE.FUN_GETFECHAVENCIMIENTOPAGO(A.ANIO,A.MES,A.NCODINST),'dd/MM/yyyy'),2)>=PK_UTIL_DATE.FN_FORMATEAR(A.DFECHAREG,'dd/MM/yyyy') THEN 'DENTRO DEL PLAZO' ELSE 'FUERA DEL PLAZO' END X23,
            A.SESTADOMU X24,
            A.NCODIGOCP X25,
            A.NCODINST X26,
            S.NORDEN X27,
            S.NCODIGO_APORTE X28,
            (CASE WHEN D.SRECIBOINGRESO IS NOT NULL THEN SUBSTR(D.SRECIBOINGRESO,1,2)||'-'||SUBSTR(D.SRECIBOINGRESO,3,6)||'-'||SUBSTR(D.SRECIBOINGRESO,9,4) ELSE '' END) X29,
            D.SNOTAREGISTRO X30
            From  sapr_aporte s
            LEFT JOIN SAPR_PAGO D on s.ncodigo_aporte=d.ncodigo_aporte  
            inner join SAPR_PAGOSINAPORTE A  ON A.NCODIGO_PSAD=D.NCODIGO_PSAD
            inner join sapr_tipodeclaracion t on t.NCODIGO_TIPODECLARACION=s.NCODIGO_TIPODECLARACION;
