  SELECT SMD.NORDEN        ORDSUBMENU,
           TSBD.SDESCRIPCION NOMSUBMENU,
           PD.SPAGINA        URLSUBMENU,
           SMD.NCODSUBMENU,
           SMD.NCODPERFIL
      FROM SAPR_SUBMENU_DETALLE  SMD
           LEFT JOIN SAPR_TITULO_SUBMENU TSBD
