  CREATE OR REPLACE FORCE EDITIONABLE VIEW "SAPREGSF1"."VW_VERFICA_PAGDEC" ("NCODIGO_PAGO", "NCODIGO_APORTE", "NCODIGO_BANCO", "DFECHAREG_PAGO", "NIMPORTE_PAGO", "SESTADO", "SNOPERACION_PAGO", "SNOMBRE_BANCO", "STIPO_PAGO", "STIPOTRIBUTO", "SDOCREF", "SNOMBRE_TIPODECLARACION", "NORDEN", "SNOTA", "CNC_NOMBRE", "DFECHAREG", "DFECHAOSI", "NCODIGO_PSAD") AS 
  SELECT P.NCODIGO_PAGO, P.NCODIGO_APORTE, 
                      P.NCODIGO_BANCO, 
                      P.DFECHAREG_PAGO, 
                      P.NIMPORTE_PAGO, P.SESTADO, P.SNOPERACION_PAGO, 
                      B.SNOMBRE_BANCO, P.STIPO_PAGO,P.STIPOTRIBUTO,P.SDOCREF,                      
                      T.SNOMBRE_TIPODECLARACION,                      
                      A.NORDEN ,                      
                      P.SNOTA,
                      C.CNC_NOMBRE,
                      S.DFECHAREG,
                      P.DFECHAOSI,S.NCODIGO_PSAD
                      FROM SAPR_PAGO P                       
                      INNER JOIN SAPR_APORTE A ON P.NCODIGO_APORTE=A.NCODIGO_APORTE
                      INNER JOIN SAPR_TIPODECLARACION T ON T.NCODIGO_TIPODECLARACION=A.NCODIGO_TIPODECLARACION                      
                      INNER JOIN SAPR_PAGOSINAPORTE S ON S.NCODIGO_PSAD=P.NCODIGO_PSAD
                      INNER JOIN SCINVGSF.T_CONCESIONARIO C ON C.CNC_ID=S.NCODINST                       
                      LEFT JOIN SAPR_BANCO B ON P.NCODIGO_BANCO = B.NCODIGO_BANCO    
                      WHERE A.NORDEN<>-1 and p.sestado<>'E';
